import React from 'react';
import ReactDOM from 'react-dom';
import 'tachyons';
import Card from './components/Card';
import './index.css';

ReactDOM.render(
  <div>
    <Card name="Cristiano Ronaldo" email="thegoat@gmail.com"/>,
    <Card name="Lionel Messi" email="the2ndgoat@gmail.com"/>,
    <Card name="Ronaldhino" email="peopleschamp@gmail.com"/>,
  </div>,
  document.getElementById('root')
);
